  console.log(playlists)

return (
  <Wrapper>
    <Content>
    (playlists.map(playlist => (
              <Playlist 
                key={playlist.id}
                name={playlist.name}
                tracks={playlist.tracks}
                  // spotify.getPlaylistTracks(playlist.id).then((data) => {
